import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    rowContainer: {
      flexDirection: 'row',
      justifyContent: 'center',
      alignItems: 'center',
      marginBottom: 5
    },
    title: {
      color: 'white',
    },
    image: {
      height: 170,
      width: 100,
      resizeMode: 'cover',
      borderRadius: 5,
      margin: 5,
    },
  });

  export default styles;
